import React from 'react';

function Item(props) {
    console.log(props)
    const {todo,changeTodoFinished} = props;
    return(
        <li>
            <label>
                <input type="checkbox" checked={todo.finished} onChange={()=>changeTodoFinished(todo.id, !todo.finished)}/>/>
                <span>{todo.title}</span>
            </label>
        </li>
    )
}

export default Item
